			try {
				data = JSON.parse(data);

				var languagesMap = {};
				var dependenciesMap = {};
				for (var p in data.languages) {
					if (p !== 'meta') {
						var title = data.languages[p].displayTitle || data.languages[p].title;
						var ucfirst = p.substring(0, 1).toUpperCase() + p.substring(1);
